INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 102301, "2030/12/17 14:59:59", 401, "アヤネ", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24, 0.0, 24001, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 102301, "2030/12/17 14:59:59", 402, "アヤネ", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24, 2.21, 24002, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 102301, "2030/12/17 14:59:59", 403, "アヤネ", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24, 0.0, 24003, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 192201, "2030/12/17 14:59:59", 701, "アサヒ", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24, 1.99, 24004, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 192201, "2030/12/17 14:59:59", 702, "アサヒ", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24, 2.21, 24005, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 192201, "2030/12/17 14:59:59", 703, "アサヒ", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24, 3.33, 24006, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 192301, "2030/12/17 14:59:59", 801, "部員３", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24, 0.0, 24007, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 192301, "2030/12/17 14:59:59", 802, "部員３", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24, 2.68, 24008, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 192301, "2030/12/17 14:59:59", 803, "部員３", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24, 0.0, 24009, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 192501, "2030/12/17 14:59:59", 501, "", "やった！", 24, 0.0, 24010, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 192501, "2030/12/17 14:59:59", 502, "", "勝ったよ！", 24, 0.0, 24011, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 192501, "2030/12/17 14:59:59", 503, "", "いい調子！", 24, 0.0, 24012, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 111, "ミサト", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24, 5.33, 24013, 6, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 112, "ミサト", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24, 6.85, 24014, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 113, "ミサト", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24, 3.0, 24015, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 192401, "2030/12/17 14:59:59", 611, "ダイチ", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24, 6.11, 24016, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 192401, "2030/12/17 14:59:59", 612, "ダイチ", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24, 6.75, 24017, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 192401, "2030/12/17 14:59:59", 613, "ダイチ", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24, 0.0, 24018, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 113401, "2030/12/17 14:59:59", 211, "ハツネ", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24, 4.52, 24019, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 113401, "2030/12/17 14:59:59", 212, "ハツネ", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24, 3.89, 24020, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113401, "2030/12/17 14:59:59", 213, "ハツネ", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24, 13.49, 24021, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 106501, "2030/12/17 14:59:59", 311, "カヤ", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24, 3.17, 24022, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 106501, "2030/12/17 14:59:59", 312, "カヤ", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24, 4.42, 24023, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 106501, "2030/12/17 14:59:59", 313, "カヤ", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24, 2.89, 24024, 6, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (3, "2020/07/31 12:00:00", 102301, "2030/12/17 14:59:59", 421, "アヤネ", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24, 3.71, 24025, 4, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 192201, "2030/12/17 14:59:59", 721, "アサヒ", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24, 5.1, 24026, 2, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (3, "2020/07/31 12:00:00", 192301, "2030/12/17 14:59:59", 821, "部員３", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24, 4.34, 24027, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 192501, "2030/12/17 14:59:59", 521, "", "いい勝負だったよ\nまたやろうね", 24, 0.0, 24028, 1, 0.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 101, "ミサト", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24, 5.62, 24029, 1, -360.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 102, "ミサト", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24, 9.58, 24030, 1, -360.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 103, "ミサト", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24, 0.0, 24031, 2, -360.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 104, "ミサト", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24, 9.13, 24032, 2, -360.0, 10046, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, "2020/07/31 12:00:00", 113501, "2030/12/17 14:59:59", 105, "ミサト", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24, 8.27, 24033, 1, -360.0, 10046, 0.0);
